import React from "react";
import styled from "styled-components";

import { Hero, Services, Contact } from "../Components/Pages";

const HomePage = () => {
  return (
    <HomeContainer>
      <Hero></Hero>
      <Services></Services>
      <Contact></Contact>
    </HomeContainer>
  );
};
const HomeContainer = styled.div`
  width: 100%;
  height: 35vh;
  .homeBg {
    width: 100%;
    height: 100%;
    object-fit: cover;
    object-position: bottom left;
  }
`;

export default HomePage;
